APP.factory("TPL",[function(){return{footerWs:'\n<div id="footer" ng-init="addr=\'163 Legionow Gdyna Poland\'">\n    <div id="panel">\n      <input id="address" type="textbox" ng-model="addr">\n      <input type="button" value="Locate on Map" ng-click="locAddress()">\n    </div>\n    <div ng-show="coords.lon">Lon: {{coords.lon}}, Lat: {{coords.lat}}</div>\n    <div ng-show="coords.elevation" class="elevation">Elevation(m): {{coords.elevation}}</div>\n    <div class="notify">{{message}}</div>\n</div>\n',leftWs:'\n<div id="left">\n    <div ng-show="channels">\n        <div class=\'buttonWrap\'>\n            <div>Channels:</div>\n            <button ng-repeat="channel in channels" ng-click="chanSel(channel[0])"\n                ng-class="vis[channel[0]]|threeWay"\n            >{{channel[0]}}</button>\n        </div>\n        <div class="buttonWrap wide">\n            <button ng-click="show(true)">Show All</button>\n            <button ng-click="show(false)">Hide All</button>\n            <button ng-click="reverse()">Reverse</button>\n            <button ng-click="toFront()" ng-class="inFront|checkActive">To Front</button>\n        </div>\n        <div class="buttonWrap">\n            <button ng-click="rng[0]=!rng[0]; range(0)" class="long" ng-class="rng[0]|checkActive">Long</button>\n            <button ng-click="rng[1]=!rng[1]; range(1)" class="med" ng-class="rng[1]|checkActive">Med</button>\n            <button ng-click="rng[2]=!rng[2]; range(2)" class="short" ng-class="rng[2]|checkActive">Short</button>\n        </div>\n        <div class=\'buttonWrap\' ng-show="selChan">\n            <ul>\n                <li>Chan: {{selChan.Channel}}</li>\n                <li>BWkHz: {{selChan.BWkHz}}</li>\n                <li>Band: {{selChan.Band}}</li>\n                <li>Freq: {{selChan.FreqMHz}}</li>\n            </ul>\n            <button ng-click="toDev(dev.loc[2])" ng-repeat="dev in chanDevs">{{dev.loc[2]}}</button>\n        </div>\n    </div>\n</div>\n',mapWs:'\n<div id="content"></div>\n',menuWs:'\n<div id="contentMenu" ng-class="active|checkActive">\n    <button ng-click="activate(\'box\');" ng-class="box|checkActive">Box</button>\n    <button ng-click="activate(\'point\');" ng-class="point|checkActive">Point</button>\n    <button ng-click="activate(\'center\');" ng-class="center|checkActive">Center</button>\n    <button ng-click="activate(\'elevation\');" ng-class="elevation|checkActive">Elevation</button>\n    <div><label for="devCenter">Center On Device Click</label><input id="devCenter" type="checkbox" ng-model="devCenter"></input></div>\n    <div><label for="autoOff">Menu Auto Off</label><input id="autoOff" type="checkbox" ng-model="autoOff"></input></div>\n</div>\n',rightWs:'\n<div id="right">\n    <div ng-show="devices">\n        <div class=\'buttonWrap\' ng-show="devices">\n            <div>Devices:</div>\n            <button ng-repeat="device in devices" ng-click="devSel(device._ID[2])"\n                ng-class="vis[device._ID[2]]|threeWay"\n            >{{device._ID[2]}}</button>\n        </div>\n        <div class="buttonWrap wide">\n            <button ng-click="show(true)">Show All</button>\n            <button ng-click="show(false)">Hide All</button>\n            <button ng-click="reverse()">Reverse</button>\n            <button ng-click="toFront()" ng-class="inFront|checkActive">To Front</button>\n        </div>\n        <div class="buttonWrap" ng-show="selDevice.Chans">\n            Device Channels:\n            <button ng-repeat="chan in selDevice.Chans">{{chan.Chan}}</button>\n        </div>\n        <div class="buttonWrap" ng-show="selDevice.Chans">\n            Device Parameters:\n            <ul>\n                <li>Id: {{selDevice.Id}}</li>\n                <li>Agl: {{selDevice.Agl}}</li>\n                <li>Address: {{selDevice.Address}}</li>\n                <li>City: {{selDevice.City}}</li>\n            </ul>\n        </div>\n    </div>\n</div>\n',whitespace:'\n<div id="container">\n    <div left-ws></div>\n    <div menu-ws></div>\n    <div map-ws></div>\n    <div right-ws devices="devices" dev-center="devCenter" to-dev-id="toDevId"></div>\n    <div footer-ws></div>\n</div>\n'}}]);